import React from "react";
import "./Card.css";

const Card = ({ title, image, status }) => {
  return (
    <div className="card">
      <img src={image} alt={title} />
      <div className="card-content">
        <h2>{title}</h2>
        <p> {status}</p>
      </div>
    </div>
  );
};

export default Card;
